export class PropHelper {
    strToBool(str) {
        if (typeof str === 'boolean') {
            return str;
        }
        return str === 'true';
    }
    strToObj(str) {
        if (!str) {
            return false;
        }
        if (typeof str === 'string') {
            return JSON.parse(str);
        }
        return str;
    }
}
export const propHelper = new PropHelper();
